import React from 'react';
import { Button } from 'react-bootstrap/Button';
const Login = ()=>{

    return (
        <>
        <div>

        </div>
            <h2>Hello</h2>
            <form >
                <input type='text'/>
                <Button variant="primary">제출</Button>{' '}
            </form>

        </>
    )
}

export default Login;
